import React from 'react';

import './Button.css'

const Button = ({ text, link }) => {
    return(
        <a
          rel="noopener noreferrer"
          href={link}
          textDecoration='none'
        >
            <div className="button">
                {text}
            </div>
        </a>
    );
}

export default Button;
